app.factory('fieldFactory', function ($http) {

    var indent = function indent(str, numOfIndents) {
        var indentString = '';
        for (var i = 0; i < numOfIndents; i++) {
            indentString = '    ' + indentString;
        }
        str = indentString + str;
        return '\n' + str;
    };

    var handleValue = function handleValue(value) {
        if (typeof value === 'string') {
            return '"' + value + '"';
        } else if (Array.isArray(value)) {
            if (!value.length) {
                return '[]';
            } else {
                var out = '';
                value.forEach(function (subval) {
                    out += handleValue(subval) + ',';
                });
                out = out.substring(0, out.length - 1);
                return '[' + out + ']';
            }
        } else {
            //booleans, numbers
            return value;
        }
    };

    function codeConverter(field) {
        var out = '';
        out += field.name + ': ';
        if (field.typeOptions.array) {
            out += '[{';
        } else {
            out += '{';
        }
        out += indent('type: ' + field.fieldType + ', ', 1);
        if (field.required === true) {
            out += indent('required: true, ', 1);
        }
        for (var key in field.typeOptions) {
            if (key === 'stringEnums' || key === 'array') {
                if (key === 'stringEnums' && field.typeOptions.stringEnums.length > 0 && field.fieldType === 'String') {
                    out += indent('enum:' + handleValue(field.typeOptions[key]) + ', ', 1);
                }
            } else {
                out += indent(key + ': ' + handleValue(field.typeOptions[key]) + ', ', 1);
            }
        }
        out = out.substring(0, out.length - 2);
        if (field.typeOptions.array) {
            out += '\n' + '}]';
        } else {
            out += '\n' + '}';
        }
        return out;
    }

    return {
        getAllFields: function getAllFields() {
            return $http.get('/api/fields/').then(function (response) {
                return response.data;
            });
        },
        getFieldById: function getFieldById(fieldId) {
            return $http.get('/api/fields/' + fieldId).then(function (response) {
                return response.data;
            });
        },
        createField: function createField(schemaId, body) {
            return $http.post('/api/fields/' + schemaId, body).then(function (response) {
                return response.data;
            });
        },
        editFieldById: function editFieldById(fieldId, updatedField) {
            return $http.put('/api/fields/' + fieldId, updatedField).then(function (response) {
                return response.data;
            });
        },
        deleteFieldById: function deleteFieldById(fieldId) {
            return $http['delete']('/api/fields/' + fieldId).then(function (response) {
                return response.data;
            });
        },
        getAllFieldsById: function getAllFieldsById(schemaId) {
            return $http.get('/api/fields/schema/' + schemaId).then(function (fields) {
                return fields.data;
            });
        },
        codeConverter: codeConverter
    };
});
app.factory('functionFactory', function ($http) {

    var indent = function indent(str, numOfIndents) {
        var indentString = '';
        for (var i = 0; i < numOfIndents; i++) {
            indentString = '    ' + indentString;
        }
        str = indentString + str;
        return '\n' + str;
    };

    function parametersHandler(parameters) {
        var out = '';
        parameters.forEach(function (parameter) {
            out += parameter + ',';
        });
        out = out.substring(0, out.length - 1);
        return out;
    }

    function codeConverter(func) {
        var out = '';

        if (!func.typeOptions.func) {
            func.typeOptions.func = '';
        }

        var makefunc = 'function (' + parametersHandler(func.typeOptions.parameters) + ') {' + indent(func.typeOptions.func, 1) + '\n' + '}';
        if (func.functionType === 'Method' || func.functionType === 'Static') {
            makefunc = makefunc + ';';
        } else {
            makefunc = makefunc + ');';
        }

        'is this a critcal bug??';

        if (func.functionType === 'Getter/Setter') {
            out += 'function ' + func.name + ' (val) {' + func.typeOptions.func + '};';
        } else {
            out += 'schema.';
            if (func.functionType === 'Virtual') {
                out += 'virtual("' + func.typeOptions.field + '").' + func.typeOptions.getset + '(' + makefunc;
            } else if (func.functionType === 'Hook') {
                out += func.typeOptions.completion + '("' + func.typeOptions.event + '", ';
                if (func.typeOptions.flow === 'Parallel') {
                    out += 'true, ';
                }
                out += makefunc;
            } else {
                out += func.functionType.toLowerCase() + 's.' + func.name + ' = ' + makefunc;
                out = out.substring(0, out.length - 1);
                out += ';';
            }
        }
        return out;
    }

    return {
        getAllFunctions: function getAllFunctions() {
            return $http.get('/api/functions/').then(function (response) {
                return response.data;
            });
        },
        getAllFunctionsById: function getAllFunctionsById(schemaId) {
            return $http.get('/api/functions/schema/' + schemaId).then(function (functions) {
                return functions.data;
            });
        },
        getFunctionById: function getFunctionById(functionId) {
            return $http.get('/api/functions/' + functionId).then(function (response) {
                return response.data;
            });
        },
        createFunction: function createFunction(schemaId, body) {
            return $http.post('/api/functions/' + schemaId, body).then(function (response) {
                return response.data;
            });
        },
        editFunctionById: function editFunctionById(functionId, updatedFunction) {
            return $http.put('/api/functions/' + functionId, updatedFunction).then(function (response) {
                return response.data;
            });
        },
        deleteFunctionById: function deleteFunctionById(functionId) {
            return $http['delete']('/api/functions/' + functionId).then(function (response) {
                return response.data;
            });
        },
        codeConverterFn: codeConverter
    };
});
